var title_f32_35_33329="Roux en Y gastric bypass";
var content_f32_35_33329=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F79256&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F79256&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Roux-en-Y gastric bypass",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 422px; height: 572px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This figure depicts the stomach's appearance after Roux-en-Y gastric bypass, which creates a small stomach pouch by dividing the stomach and attaching it to the small intestine. The pouch is only able to hold about an ounce of food, causing a feeling of fullness after consuming a very small amount; over time, the pouch stretches to hold about one cup. In addition, the body absorbs fewer calories since food bypasses the majority of the stomach as well as the upper small intestine (duodenum). This intestinal arrangement (Roux-en-Y) seems to cause decreased appetite and improved metabolism by changing the release of various hormones.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
