"    <li>",
"     <div class=\"reference\">",
"      Donohoe KJ, Brown ML, Collier BD, et al, \"Society of Nuclear Medicine Procedure Guideline for Bone Scintigraphy,\" 2003. Available at file://interactive.snm.org/docs/pg_ch34_0403.pdf. Last accessed August 31, 2011.",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Ford PV, Bartold SP, Fink-Bennett DM, et al, \"Procedure Guideline for Gastrointestinal Bleeding and Meckel&rsquo;s Diverticulum Scintigraphy. Society of Nuclear Medicine,\"",
"      <i>",
"       J Nucl Med",
"      </i>",
"      , 1999, 40(7):1226-32. Available at file://interactive.snm.org/docs/pg_ch09_0403.pdf. Last accessed August 30, 2011.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?32/35/33330/abstract-text/10405149/pubmed\" id=\"10405149\" target=\"_blank\">",
"        10405149",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Mountford PJ and Coakley AJ, \"A Review of the Secretion of Radioactivity in Human Breast Milk: Data, Quantitative Analysis and Recommendations,\"",
"      <i>",
"       Nucl Med Commun",
"      </i>",
"      , 1989, 10(1):15-27.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?32/35/33330/abstract-text/2645546/pubmed\" id=\"2645546\" target=\"_blank\">",
"        2645546",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Scheiner J, Sinusas A, Wittry MD, et al, \"Society of Nuclear Medicine Procedure Guideline for Gated Equilibrium Radionuclide Ventriculography,\" 2002. Available at file://interactive.snm.org/docs/pg_ch01_0403.pdf. Last accessed August 30, 2011.",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Stabin MG and Breitz HB, \"Breast Milk Excretion of Radiopharmaceuticals: Mechanisms, Findings, and Radiation Dosimetry,\"",
"      <i>",
"       J Nucl Med",
"      </i>",
"      , 2000, 41(5):863-73.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?32/35/33330/abstract-text/10809203/pubmed\" id=\"10809203\" target=\"_blank\">",
