var title_f32_35_33338="Superior sulcus PA";
var content_f32_35_33338=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F59658%7EPULM%2F79073%7EPULM%2F72484%7EPULM%2F68761%7EPULM%2F57052%7EPULM%2F78739%7EPULM%2F61004&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F59658%7EPULM%2F79073%7EPULM%2F72484%7EPULM%2F68761%7EPULM%2F57052%7EPULM%2F78739%7EPULM%2F61004&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Superior sulcus tumor",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 372px; height: 307px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Patient with superior sulcus tumor at the right apex. Chest radiograph shows a right upper lobe nodule with adjacent apical cap.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Superior sulcus tumor",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 367px; height: 235px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    CT scan confirms the tumor and demonstrates chest wall invasion with partial rib destruction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Superior sulcus tumor",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 342px; height: 235px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Coronal PET scan shows the glucose avid right apical tumor as well as a lower rib metastasis (arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Central bronchogenic carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 380px; height: 344px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Patient with advanced lung cancer. Chest radiograph shows complete atelectasis of the right lung.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Central bronchogenic carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 388px; height: 299px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    CT scan confirms the collapse of the right lung with heterogeneous enhancement of the nonaerated lung parenchyma. The right mainstem bronchus is markedly narrowed.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 551px\">",
"   <div class=\"ttl\">",
"    Central bronchogenic carcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 531px; height: 450px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Two coronal (top) and one axial PET scan (left) show marked glucose uptake in the central region of the collapsed lung as well as cirumferential uptake in the periphery of the lung. The glucose avid lymph node (arrow) in the left axilla was biopsied and proved to be inflammatory.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Fluoro-deoxyglucose scan of mediastinal metastasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 399px; height: 219px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Primary tumor in the right lung with mediastinal metastatic focus (N2, arrow) demonstrated with FDG PET whole body scan in posterior coronal, sagittal, and axial projection.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
