var title_f32_35_33339="Noncontraceptive benefits";
var content_f32_35_33339=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F82147&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F82147&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Potential noncontraceptive benefits of cyclic estrogen-progestin contraceptives",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        &bull; Reduction in dysmenorrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in pelvic pain related to endometriosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction of menorrhagia, with improvement in iron deficiency anemia related to blood loss",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in risk of ectopic pregnancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in symptoms associated with premenstrual syndrome and premenstrual dysphoric disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in risk of benign breast disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in development of new ovarian cysts (true for higher dose estrogen pills only, which suppress ovulation), but no effect on existing ovarian cysts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in ovarian cancer, including some hereditary forms such as those associated with mutations in the BRCA1 or BRCA2 gene, presumably due to inhibition of ovarian stimulation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in endometrial cancer, due the progestin effect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in colorectal cancer in current users",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in moderate acne",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Reduction in hirsutism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; More regular menstrual cycles",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    In addition, there may be a reduction in postmenopausal hip fracture risk for women who use estrogen-containing contraceptives in their 40s. Also, extended cycle or continuous estrogen-progestin contraception can reduce symptoms of menstrual migraine.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
